DELIMITER $$

CREATE PROCEDURE AddExpectedServiceProcesses()
BEGIN
    DECLARE today DATE;
    SET today = CURDATE();

    INSERT INTO test1.service_process (service_id, status, start_time, end_time, schedule_id)
    SELECT
        s.service_id,
        'EXPECTED',
        s.start_time,
        s.end_time,
        s.id AS schedule_id
    FROM
        test1.schedule s
    WHERE
        DATE(s.start_time) = today
      AND NOT EXISTS (
        SELECT 1
        FROM test1.service_process sp
        WHERE sp.schedule_id = s.id
    );
END$$

DELIMITER ;


SET GLOBAL event_scheduler = ON;

CREATE EVENT AddExpectedServiceProcessesEvent
    ON SCHEDULE EVERY 1 MINUTE
    DO
    CALL AddExpectedServiceProcesses();